import React from 'react'

import './card-list.style.css';

export const Cardlist = (props) => {
    console.log(props)
    return <div className = 'card-list'>
           <h1>Moe Latt</h1>
            <h1>Htoo Htoo</h1>
          {/* between carlibrace{} with can write any java script */}
         {
           props.monsters.map(monsters => (<h1 key = {monsters.id}>{monsters.name}</h1>))
         }
    </div>;
}
